import React, { Component, PropTypes } from 'react';
import axios from 'axios';
import { Grid } from '@material-ui/core';
import Plot from 'react-plotly.js';
import LinearProgress from '@material-ui/core/LinearProgress';
import Typography from '@material-ui/core/Typography';
class WorldMap extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        const world_=this.props.world;
        let displayworld=world_? (
            <div>
                <h4><center>Summary of Confirmed cases as per Age Gruops</center></h4>

            <div>
                <Plot data={world_.chart}
                useResizeHandler={true}
                responsive={true}
                frames={world_.frames}
                layout={world_.layout}

                ></Plot>
            </div>

            </div>
            ):
            <div className="padding10per">
            <Typography color="textSecondary">Loading...</Typography>
            <LinearProgress color="secondary" />
            </div>;
            return(
            <Grid container>
                    <Grid item sm={12} xs={12}>
                        <div>{displayworld}</div>
                    </Grid>

                </Grid>
            );                

    }
}

export default WorldMap;
